import React, { Component } from "react";
import { Navbar, Nav, NavItem ,Form,FormControl,Button} from "react-bootstrap";
import { Link } from "react-router-dom";
class navbar extends Component {
  render() {
    return (
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">GitHub</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="/" className=" m-2 btn btn-secondary">Home</Nav.Link>
      <Nav.Link href="news"  className=" m-2 btn btn-secondary">News</Nav.Link>
      <Nav.Link href="about"  className="m-2 btn btn-secondary">About</Nav.Link>
    </Nav>
  </Navbar>
    );
  }
}

export default navbar;
